import React from 'react';
import { useNavigate } from 'react-router-dom';

const IntakeForms: React.FC = () => {
  const navigate = useNavigate();

  return (
    <div className="min-h-screen bg-gradient-to-br from-indigo-50 to-blue-50 py-16 px-4">
      <div className="max-w-7xl mx-auto">
        <h1 className="text-4xl font-bold text-indigo-900 mb-8">Select an Intake Form</h1>
        <div className="grid grid-cols-1 sm:grid-cols-2 lg:grid-cols-3 gap-6">
          {/* Intake Form 1 */}
          <div className="bg-white p-6 shadow-lg rounded-lg">
            <h2 className="text-xl font-bold text-indigo-900">General Intake Form</h2>
            <p className="text-gray-700 mt-2">
              Fill out this form for general support services.
            </p>
            <button
              onClick={() => navigate('/intake/general')}
              className="mt-4 px-4 py-2 bg-indigo-600 text-white rounded-lg hover:bg-indigo-700"
            >
              Open Form
            </button>
          </div>
          {/* Add more forms as needed */}
          <div className="bg-white p-6 shadow-lg rounded-lg">
            <h2 className="text-xl font-bold text-indigo-900">Employment Intake Form</h2>
            <p className="text-gray-700 mt-2">
              Fill out this form for employment-related assistance.
            </p>
            <button
              onClick={() => navigate('/intake/employment')}
              className="mt-4 px-4 py-2 bg-indigo-600 text-white rounded-lg hover:bg-indigo-700"
            >
              Open Form
            </button>
          </div>
        </div>
      </div>
    </div>
  );
};

export default IntakeForms;
